import React, { Component } from "react";

export default class Recrutement extends Component {
  render() {
    return (
      <div className="servicesBottle">
        <h3 className="servicesTitle">Le processus de recrutement</h3>
        <div className="exampleTiret" />
      </div>
    );
  }
}
